2\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u0421\u0428\u0410\">\u0412\u043e\u0439\u043d\u044b \u0437\u0430 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u0421\u0428\u0410<\/a> \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u043b\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%8B%D1%81%D0%B0%D0%B4%D0%BA%D0%B0_%D0%B2_%D0%9D%D0%B0%D1%81%D1%81%D0%B0%D1%83\" title=\"\u0412\u044b\u0441\u0430\u0434\u043a\u0430 \u0432 \u041d\u0430\u0441\u0441\u0430\u0443\">\u0420\u0435\u0439\u0434 \u0432 \u041d\u0430\u0441\u0441\u0430\u0443<\/a>. \u041e\u0442 \u043d\u0435\u0433\u043e \u0432\u0435\u0434\u0451\u0442 \u0441\u0432\u043e\u044e \u0438\u0441\u0442\u043e\u0440\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%BF%D1%83%D1%81_%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%BE%D0%B9_%D0%BF%D0%B5%D1%85%D0%BE%D1%82%D1%8B_%D0%A1%D0%A8%D0%90\" title=\"\u041a\u043e\u0440\u043f\u0443\u0441 \u043c\u043e\u0440\u0441\u043a\u043e\u0439 \u043f\u0435\u0445\u043e\u0442\u044b \u0421\u0428\u0410\">\u041a\u043e\u0440\u043f\u0443\u0441 \u043c\u043e\u0440\u0441\u043a\u043e\u0439 \u043f\u0435\u0445\u043e\u0442\u044b \u0421\u0428\u0410<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1799\" class=\"mw-redirect\" title=\"1799\">1799<\/a>&#160;\u2014 \u043f\u043e\u0441\u043b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D0%B0%D0%B4%D0%B0_%D0%9A%D0%BE%D1%80%D1%84%D1%83_(1798%E2%80%941799)\" title=\"\u041e\u0441\u0430\u0434\u0430 \u041a\u043e\u0440\u0444\u0443 (1798\u20141799)\">\u043c\u043d\u043e\u0433\u043e\u043c\u0435\u0441\u044f\u0447\u043d\u043e\u0439 \u043e\u0441\u0430\u0434\u044b<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%80%D0%BD%D0%BE%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D1%84%D0%BB%D0%BE%D1%82_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D0%B8\" class=\"mw-redirect\" title=\"\u0427\u0435\u0440\u043d\u043e\u043c\u043e\u0440\