edia.org\/wiki\/%D0%A3%D0%BA%D0%B0%D0%B7\" title=\"\u0423\u043a\u0430\u0437\">\u0423\u043a\u0430\u0437<\/a> \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_I\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 I\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 I<\/a> \u043e \u0437\u0430\u043f\u0440\u0435\u0449\u0435\u043d\u0438\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a> \u043f\u0440\u043e\u0434\u0430\u0436\u0438 \u043a\u0440\u0435\u0441\u0442\u044c\u044f\u043d \u0431\u0435\u0437 \u0437\u0435\u043c\u043b\u0438, \u043e \u0440\u0430\u0437\u0440\u0435\u0448\u0435\u043d\u0438\u0438 \u0438\u043c \u0432\u0441\u0442\u0443\u043f\u0430\u0442\u044c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D1%87%D0%BD%D1%8B%D0%B9_%D1%81%D0%BE%D1%8E%D0%B7\" title=\"\u0411\u0440\u0430\u0447\u043d\u044b\u0439 \u0441\u043e\u044e\u0437\">\u0431\u0440\u0430\u043a<\/a> \u0431\u0435\u0437 \u0441\u043e\u0433\u043b\u0430\u0441\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BC%D0%B5%D1%89%D0%B8%D0%BA\" title=\"\u041f\u043e\u043c\u0435\u0449\u0438\u043a\">\u043f\u043e\u043c\u0435\u0449\u0438\u043a\u0430<\/a> \u0438 \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u0438\u0438 \u043d\u0430\u043a\u0430\u0437\u0430\u043d\u0438\u0439 \u0441 \u0435\u0433\u043e \u0441\u0442\u043e\u0440\u043e\u043d\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1813\" class=\"mw-redirect\" title=\"1813\">1813<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%B