41c\u043e\u0441\u043a\u0432\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0441\u044f \u0414\u043e\u043c \u043f\u0435\u0447\u0430\u0442\u0438 (\u043d\u044b\u043d\u0435 \u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u0434\u043e\u043c \u0436\u0443\u0440\u043d\u0430\u043b\u0438\u0441\u0442\u0430).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921\" class=\"mw-redirect\" title=\"1921\">1921<\/a><ul><li>\u041a\u0430\u043d\u0430\u0434\u0441\u043a\u0438\u0439 \u0444\u0438\u0437\u0438\u043e\u043b\u043e\u0433 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BD%D1%82%D0%B8%D0%BD%D0%B3,_%D0%A4%D1%80%D0%B5%D0%B4%D0%B5%D1%80%D0%B8%D0%BA\" title=\"\u0411\u0430\u043d\u0442\u0438\u043d\u0433, \u0424\u0440\u0435\u0434\u0435\u0440\u0438\u043a\">\u0424\u0440\u0435\u0434\u0435\u0440\u0438\u043a \u0413\u0440\u0430\u043d\u0442 \u0411\u0430\u043d\u0442\u0438\u043d\u0433<\/a> \u0441\u043e\u0432\u043c\u0435\u0441\u0442\u043d\u043e \u0441 \u043a\u043e\u043b\u043b\u0435\u0433\u0430\u043c\u0438 \u043e\u0442\u043a\u0440\u044b\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%80%D0%BC%D0%BE%D0%BD%D1%8B\" title=\"\u0413\u043e\u0440\u043c\u043e\u043d\u044b\">\u0433\u043e\u0440\u043c\u043e\u043d<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D1%81%D1%83%D0%BB%D0%B8%D0%BD\" title=\"\u0418\u043d\u0441\u0443\u043b\u0438\u043d\">\u0438\u043d\u0441\u0443\u043b\u0438\u043d<\/a>, \u0437\u0430 \u0447\u0442\u043e \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u0432 1923 \u0433\u043e\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B1%D0%B5%D0%BB%D0%B5%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D1%80%D0%B5%D0%BC%D0%B8%D1%8F\" title=\"\u041d\u043e\u0431\u0435\u043b\u0435\u0432\u0441\u043a\u0430\u044f \u043f\u0440\u0435\u043c\u0438\u044f\">\u041d\u043e\u0431\u0435\u043b\u0435\u0432\u0441\u043a\u0443\u044e \u043f\u0440\u0435\u043c\u0438\u044e<\/a>.<\/li><li>\u0413\u043e\u043d\u043a\u043e\u043d\u0433\u0441\u043a\u0438\u0439 \u043f\u0430\u0440\u043e\u0445\u043e\u0434 \u00abHong Moh\u00bb (\u0437\u0430\u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0439 \u0432 \u0421\u0438\u043d\u0433\u0430\u043f\u0443\u0440\u0435) \u0440\u0430\u0437\u043b\u043e\u043c\u0438\u043b\u0441\u044f \u043f\u043e\u043f\u043e\u043b\u0430\u043c, \u043d\u0430\u043f\u043e\u0440\u043e\u0432\u0448\u0438\u0441\u044c \u043d\u0430 \u043f\u043e\u0434\u0432\u043e\u0434\u043d\u044b\u0435 \u0441\u043a\u0430\u043b\u044b  \u0443 \u0413\u0432\u0430\u043d\u0434\u043e\u043d\u0433\u0430 , \u043a\u0443\u0434\u0430 \u0431\u044b\u043b \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d \u043f\u043e\u0441\u043b\u0435 \u0442\u043e\u0433\u043e, \u043a\u0430\u043a \u0443\u0431\u0438\u0432\u0448\u0438\u0435 \u043a\u0430\u043f\u0438\u0442\u0430\u043d\u0430 \u0431\u0430\u043d\u0434\u0438\u0442\u044b \u043e\u0442\u043a\u0440\u044b\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%BD%D0%B3%D1%81%D1%82%D0%BE%D0%BD_(%D0%BA%D0%BB%D0%B0%D0%BF%D0%B0%D0%BD)\" title=\"\u041a\u0438\u043d\u0433\u0441\u0442\u043e\u043d (\u043a\u043b\u0430\u043f\u0430\u043d)\">\u043a\u0438\u043d\u0433\u0441\u0442\u043e\u043d\u044b<\/a>. \u0418\u0437 1100\u20141200 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u0431\u044b\u043b\u043e \u0441\u043f\u0430\u0441\u0435\u043d\u043e 294.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1923\" class=\"mw-redirect\" title=\"1923\">1923<\/a><ul><li>\u0412 \u043f\u0440\u043e\u0434\u0430\u0436\u0443 \u043f\u043e\u0441\u0442\u0443\u043f\u0438\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u043c\u0438\u0440\u0435 \u043d\u043e\u0432\u043e\u0441\u0442\u043d\u043e\u0439 \u0435\u0436\u0435\u043d\u0435\u0434\u0435\u043b\u044c\u043d\u0438\u043a&#160;\u2014 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Time\" title=\"Time\">Time<\/a>\u00bb.<\/li><li>\u0422\u0440\u0443\u043f\u043f\u0430 \u0431\u0443\u0434\u0443\u0449\u0435\u0433\u043e <a href=\"https:\/\/r